I've been trying to run my_web_server.js and am finding that it doesn't display anything on my browser.  Postman also says that it couldn't get a response.  Here's my code:

```
var http = require('http');

http.createServer(function (req, res) {
  res.writeHead(200, {'Content-Type': 'text/plain'});
  res.end('Hello Alexia\n');
}).listen(8080);

console.log('Server running on port 8080.');
```

And here's the command and output:

```
$ node my_web_server.js 
Server running on port 8080.
```

I am able to ping localhost and the output seems fine, which is why I'm confused.  Any ideas?  It may be a mac issue...

